import { useEffect, useState } from "react";
import CIVIC_INFO_API_KEY from '/.apiKeys';

function GetReps() {

    const [reps, setReps] = useState([])

    const params = {
        address: "94501",
        includeOffices: true,
        levels: "country",
        roles: ["legislatorLowerBody", "legislatorUpperBody"],
    }

    const getData = async () => {
        const response = await fetch('https://www.googleapis.com/civicinfo/v2/representatives');
        if (response.ok) {
            const data = await response.json();
            setReps(data.reps)
        }
    }

    useEffect(() => {
        getData()
    }, [])

    console.log(reps)

    return (
        "hello world"
    );
}

export default GetReps;
